unsigned int luaO_codeparam (unsigned int p) {
  if (p >= (cast(lu_mem, 0x1F) << (0xF - 7 - 1)) * 100u)  
    return 0xFF;  
  else {
    p = (cast(l_uint32, p) * 128 + 99) / 100;  
    if (p < 0x10)  
      return p;  
    else {
      int log = luaO_ceillog2(p + 1) - 5;  
      return ((p >> log) - 0x10) | ((log + 1) << 4);
    }
  }
}

